import React from "react";
import AboutUs from "../Components/website/AboutUs";
import TeamMembers from "../Components/website/Team";
import Service from "../Components/Landing/Service";

const About = () => {
  return (
    <div>
      <AboutUs />
      <TeamMembers />
      <Service />
    </div>
  );
};

export default About;
